import { homedir } from "os"
import { resolve } from "path"
import { getDirectoryTree } from "./getDirectoryTree"

const defaultPath = resolve(homedir(),'Desktop','front-end-book', 'Markdowns')
export const getFileList = (filePath?:string) =>{
    const targetPath = filePath ? filePath:defaultPath
    const fileList = getDirectoryTree(targetPath)
    return fileList
}
